INSERT INTO public.i18n ("createdAt", "createdBy", lang, key, version, value, "releaseVersion", "needsUpdate") VALUES ('2022-04-04 09:04:49.844', '0x3a599ab30a17bc7527d8be6d434f3048ea92d5d7', 'id', 'dapps.o-passport.processes.identify.acquireSession.authenticate.authenticate2.editorContent.terms_privacy.description', 1, 'CirclesLand is built on a blockchain, which by design is a transparent and permanent decentralized database. With your signup you agree that your profile, transactions and friend connections will be irrevocably public.<br/><br/><span class=''text-xs''>For details read our <a href=''https://blog.circles.land/terms-of-service'' class=''text-primary'' target=''_blank'' alt=''privacy policy & terms of service''>privacy policy & terms of service</a></span>', 0, false) ON CONFLICT DO NOTHING;
