INSERT INTO public.i18n ("createdAt", "createdBy", lang, key, version, value, "releaseVersion", "needsUpdate") VALUES ('2022-03-23 08:31:51.054', '0x3a599ab30a17bc7527d8be6d434f3048ea92d5d7', 'de', 'dapps.o-passport.processes.identify.createSafe.createSafe.editorContent.seedphraseCheck.description', 1, 'Keep in mind, <span class=''text-alert''>everyone who knows</span> your Secret Recovery Code can <span class=''text-alert''>access all you money</span>.<br /><br /><span class=''text-xs''>Please save your Secret Recovery Code in your notes <span class=''text-alert''>\(not secure\)</span>, a password manager <span class=''text-alert''>\(secure\)</span> or write it down on a paper and put it in your safe <span class=''text-alert''>\(most secure\)</span>.', 0, false) ON CONFLICT DO NOTHING;
INSERT INTO public.i18n ("createdAt", "createdBy", lang, key, version, value, "releaseVersion", "needsUpdate") VALUES ('2022-06-14 12:29:02.324', '0x3a599ab30a17bc7527d8be6d434f3048ea92d5d7', 'de', 'dapps.o-passport.processes.identify.createSafe.createSafe.editorContent.seedphraseCheck.description', 2, 'Denke immer daran, <span class=''text-alter''>jeder, mit Deinem</span> geheimen Wiederherstellungscode, <span class=''text-alert''>hat Zugriff auf all Dein Geld</span>.<br /><br /><span class=''text-xs''>Bitte schreibe Deinen Wiederherstellunscode in Deine Notitzen <span class=''text-alert''>\(nicht sicher\)</span>, speichere ihn in einem Passwort-Manager <span class=''text-alert''>\(sicher\)</span> oder schreibe ihn auf einen Zettel und lege diesen in Deinen Safe <span class=''text-alert''>\(am sichersten\)</span>', 0, false) ON CONFLICT DO NOTHING;
INSERT INTO public.i18n ("createdAt", "createdBy", lang, key, version, value, "releaseVersion", "needsUpdate") VALUES ('2022-06-14 12:29:40.898', '0x3a599ab30a17bc7527d8be6d434f3048ea92d5d7', 'de', 'dapps.o-passport.processes.identify.createSafe.createSafe.editorContent.seedphraseCheck.title', 2, 'SAFE Code SICHER', 0, false) ON CONFLICT DO NOTHING;
INSERT INTO public.i18n ("createdAt", "createdBy", lang, key, version, value, "releaseVersion", "needsUpdate") VALUES ('2022-03-23 08:31:51.054', '0x3a599ab30a17bc7527d8be6d434f3048ea92d5d7', 'de', 'dapps.o-passport.processes.identify.createSafe.createSafe.editorContent.seedphrase.description', 1, 'Your Secret Recovery Code is the<span class=''text-alert''>only key</span>which can access your safe. It is your<span class=''text-alert''>full responsibility</span>to<span class=''text-alert''>protect</span>this code like a<span class=''text-alert''>password</span>.<br /><br /><span class=''text-xs''>If you loose it or forget it, all your<span class=''text-alert''>money is lost forever</span>.</span>', 0, false) ON CONFLICT DO NOTHING;
INSERT INTO public.i18n ("createdAt", "createdBy", lang, key, version, value, "releaseVersion", "needsUpdate") VALUES ('2022-06-14 12:19:57.660', '0x3a599ab30a17bc7527d8be6d434f3048ea92d5d7', 'de', 'dapps.o-passport.processes.identify.createSafe.createSafe.editorContent.seedphrase.description', 2, 'Dein geheimer Wiederherstllungscode ist der<span class=''text-alert''>einzige key</span>der auf Deinen Safe zugreifen kann. Es liegt in Deiner<span class=''text-alert''>Verantwortung</span>diesen zu<span class=''text-alert''>schützen</span>Dieser Code ist wie ein<span class=''text-alert''>Passwort</span>.<br /><br /><span class=''text-xs''>Wenn du ihn verlierst oder vergisst, ist all dein<span class=''text-alert''>Geld für immer verloren</span>.</span>', 0, false) ON CONFLICT DO NOTHING;
