INSERT INTO public.i18n ("createdAt", "createdBy", lang, key, version, value, "releaseVersion", "needsUpdate") VALUES ('2022-03-23 08:31:51.054', '0x3a599ab30a17bc7527d8be6d434f3048ea92d5d7', 'de', 'dapps.o-passport.processes.identify.createSafe.createSafe.strings.labelCheckSeedphrase', 1, 'Keep in mind, everyone who knows your Secret Recovery Code can access all your funds! Did you store your Secret Recovery Code in a password manager or have you written it down on a paper, that you put into a secret place? <strong class=''text-primary block mt-3''>Repeat your Secret Recovery Code</strong>', 0, false) ON CONFLICT DO NOTHING;
INSERT INTO public.i18n ("createdAt", "createdBy", lang, key, version, value, "releaseVersion", "needsUpdate") VALUES ('2022-06-14 12:34:36.567', '0x3a599ab30a17bc7527d8be6d434f3048ea92d5d7', 'de', 'dapps.o-passport.processes.identify.createSafe.createSafe.strings.labelCheckSeedphrase', 2, 'Denke daran, dass jeder, der Deinen geheimen WIederherstellungscode kennt, auf alle Deine Gelder zugreifen kann! Hast Du deinen geheimen Wiederherstellungscode in einem Passwortmanager gespeichert oder ihn aufgeschrieben und an einem sicheren Ort verwahrt? <string class=''text-primary block mt-3''>Wiederhole Deinen geheimen Wiederherstellunscode</strong>', 0, false) ON CONFLICT DO NOTHING;
INSERT INTO public.i18n ("createdAt", "createdBy", lang, key, version, value, "releaseVersion", "needsUpdate") VALUES ('2022-03-23 08:31:51.054', '0x3a599ab30a17bc7527d8be6d434f3048ea92d5d7', 'de', 'dapps.o-passport.processes.identify.createSafe.createSafe.strings.labelExportSeedphrase', 1, 'Your Secret Recovery Code is the<span class=''text-alert''>only key</span> which can access your safe. It is your <span class=''text-alert''>full responsibility</span> to <span class=''text-alert''>protect</span> this code like a <span class=''text-alert''>password</span>.<br /><br /><span class=''text-xs''>If you loose it or forget it, all your <span class=''text-alert''>money is lost forever</span>.</span>', 0, false) ON CONFLICT DO NOTHING;
