INSERT INTO public.i18n ("createdAt", "createdBy", lang, key, version, value, "releaseVersion", "needsUpdate") VALUES ('2022-03-23 08:31:51.054', '0x3a599ab30a17bc7527d8be6d434f3048ea92d5d7', 'de', 'dapps.o-passport.processes.identify.identify2.getInvite.htmlContext', 1, '<section class=''mb-8''><div class=''w-full px-2 pb-4 -mt-3 bg-white rounded-sm''><div class=''px-4 py-2 mr-4 -ml-3 text-center '' /><div style=''text-align: center''><p class=''w-64 m-auto mt-2 text-2xl font-bold  text-gradient''>You''re almost there.</p><p class=''mt-4 text''>To activate your citizenship you need to be invited.<br/>Send your profile link to a CirclesLand citizen to unlock your basic income.</p><div class=''mt-4 mb-4 text-xs break-all'' id=''clipboard''><input type=''text'' class=''hidden'' value=''${profileLink}'' /><div class=''inline-block text-2xl''><button class=''btn btn-primary''>Copy profile Link</button></div><div class=''block mt-2 text-sm text-light ''>${profileLink}</div></div><p class=''text''>If you don''t know anybody who has Circles yet, ask nicely in our <a href=''https://discord.gg/4DBbRCMnFZ'' target=''_blank'' class=''btn-link''>Discord</a> if someone can activate your citizenship.</p><p class=''pb-4 mt-4 text-xs text-light''>alternatively, <a href=''#/home/become-a-hub'' class=''btn-link''>unlock yourself</a> and grow a new local community</a></p><div class=''mr-1 text-primary'' /></div></div></section>', 0, false) ON CONFLICT DO NOTHING;
INSERT INTO public.i18n ("createdAt", "createdBy", lang, key, version, value, "releaseVersion", "needsUpdate") VALUES ('2022-06-14 12:43:54.454', '0x3a599ab30a17bc7527d8be6d434f3048ea92d5d7', 'de', 'dapps.o-passport.processes.identify.identify2.getInvite.htmlContext', 2, '<section class=''mb-8''><div class=''w-full px-2 pb-4 -mt-3 bg-white rounded-sm''><div class=''px-4 py-2 mr-4 -ml-3 text-center '' /><div style=''text-align: center''><p class=''w-64 m-auto mt-2 text-2xl font-bold text-gradient''>Du hast es fast geschafft.</p><p class=''mt-4 text''>Um deine Staatsbürgerschaft zu aktivieren, musst Du eingeladen werden.</br>Sende Dein Profil-Link an einen CirclesLand Bürger, um dein Grundeinkommen freizuschalten.</p><div class=''mt-4 mb-4 text-xs break-all'' id=''clipboard''><input type=''text'' class=''hidden'' value=''${profileLink}'' /><div class=''inline-block text-2xl''><button class=''btn btn-primary''>Profil-Link kopieren</button></div><div class=''block mt-2 text-sm text-light ''>${profileLink}</div></div><p class=''text''>Wenn du niemanden kennst, der Circles hat, frag gerne in unserem <a href=''https://discord.gg/4DBbRCMnFZ'' target=''_blank'' class=''btn-link''>Discord</a>ob jemand deine Staatsbürgerschaft aktivieren kann.</p><p class=''pb-4 mt-4 text-xs text-light''>Alternativ, <a href=''#/home/become-a-hub'' class=''btn-link''>schalte Dich selbst frei</a> und baue eine neue lokale Community auf</a></p><div class=''mr-1 text-primary'' /></div></div></section>', 0, false) ON CONFLICT DO NOTHING;
