INSERT INTO public.i18n ("createdAt", "createdBy", lang, key, version, value, "releaseVersion", "needsUpdate") VALUES ('2022-07-11 00:36:44.153', '0x92cf07e6f20572dcb186691128c25e488d37bfc1', 'id', 'dapps.o-passport.processes.identify.identify2.getInvite.htmlContext', 2, '<section class=''mb-8''><div class=''w-full px-2 pb-4 -mt-3 bg-white rounded-sm''><div class=''px-4 py-2 mr-4 -ml-3 text-center '' /><div style=''text-align: center''><p class=''w-64 m-auto mt-2 text-2xl font-bold text-gradient''>Anda hampir sampai.</p><p class=''mt-4 text''>Untuk mengaktifkan kewarganegaraan Anda, Anda perlu diundang.<br/>Kirim tautan profil Anda ke warga CirclesLand untuk membuka penghasilan dasar Anda.</p> <div class=''mt-4 mb-4 text-xs break-all'' id=''clipboard''><input type=''text'' class=''hidden'' value=''${profileLink}'' /><div class= ''inline-block text-2xl''><button class=''btn btn-primary''>Salin Tautan profil</button></div><div class=''block mt-2 text-sm text-light ''>${ profileLink}</div></div><p class=''text''>Jika Anda belum mengenal siapa pun yang memiliki Lingkaran, tanyakan baik-baik di target <a href=''https://discord.gg/4DBbRCMnFZ'' kami =''_blank'' class=''btn-link''>Discord</a> jika seseorang dapat mengaktifkan kewarganegaraan Anda.</p><p class=''pb-4 mt-4 text-xs text-light''>sebagai alternatif, < a href=''#/home/become-a-hub'' class=''btn-link''>u kunci diri Anda</a> dan kembangkan komunitas lokal baru</a></p><div class=''mr-1 text-primary'' /></div></div></section>', 0, false) ON CONFLICT DO NOTHING;
